function Tarefa(){
  arr.forEach( item => {<Tarefas objetivo={item}/>} )
}

const TodoList = () =>{
  return (
    <div>
      <ul>
        {Tarefa}
      </ul>
      <ButtonAddTarefa />
    </div>
  )
}

export default TodoList;
